'use strict';

$(document).ready(function () {
    var sliderContainer = $('.infoblock-2s-image-slider');
    var lengSlides = $('.infoblock-2s-image-slider > .swiper-wrapper > .swiper-slide');
    if (lengSlides.length > 1) {
        var swiper = new Swiper(sliderContainer, {
            slidesPerView: 1,
            spaceBetween: 20,
            pagination: {
                el: '.swiper-pagination',
                dynamicBullets: true,
                clickable: true,
                hide: true
            }
        });
    } else {
        return false;
    }
});
'use strict';

$(document).ready(function () {
    var cat = $('.cat-tabs'),
        catLinks = $('.cat-tabs-links');

    var catSlider = new Swiper('.cat-tabs-wrapper .swiper-container', {
        slidesPerView: 1,
        loop: false,
        centeredSlides: false,
        spaceBetween: 0,
        pagination: {
            el: '.cat-tabs-dots',
            clickable: true
        },
        paginationClickable: true,
        mousewheelControl: true,
        autoHeight: true,
        autoplay: {
            delay: 5000,
            disableOnInteraction: true
        }

    });
    $('.swiper-container').on('mouseenter', function () {
        catSlider.autoplay.stop();
    });
    $('.swiper-container').on('mouseleave', function () {
        catSlider.autoplay.start();
    });

    catSlider.on('slideChange', function () {
        catLinks.find('span.active').removeClass('active');
        catLinks.find('span[data-cat=' + catSlider.realIndex + ']').addClass('active');
    });

    if (cat.length > 0) {
        catLinks.find('span').click(function () {
            var catid = $(this).data('cat');
            catSlider.slideTo(catid, 450);
            catLinks.find('span.active').removeClass('active');
            $(this).addClass('active');
        });
    }
});
'use strict';

$(document).ready(function () {
    $('.contacts-form__reset-button').click(function () {
        setTimeout(function () {
            $('.contacts-form').find('select, input').trigger('refresh');
        }, 200);
    });
});
