    var modal = function modal(id) {
        var $moData = $('.modal[data-modal=' + id + ']');

        if ($moData.length < 1) {
            return;
        }
        this.open = function () {
            $moData.addClass('modal--open').fadeIn(300);
            $body.addClass('modal-has-opened');
        };
        this.close = function () {
            $moData.removeClass('modal--open').fadeOut(300);
            $body.removeClass('modal-has-opened');
        };
        return this;
    };

